const Chevron = (props) => {
  return (
    <>
      {props.disabled ? (
        <div
          className={
            props.chevronDirection === "right"
              ? "chevron-right-disabled"
              : "chevron-left-disabled"
          }
        ></div>
      ) : (
        <div
          className={
            props.chevronDirection === "right"
              ? "chevron-right"
              : "chevron-left"
          }
        ></div>
      )}
    </>
  );
};

export default Chevron;
